<style lang="scss">
	.foreground {
		width: 100%;
		min-height: 10rem;
		position: fixed;
		bottom: 0;
		left: 0;
		overflow: hidden;
		display: flex;

		svg {
			margin-top: auto;
			display: block;
			fill: var(--sky-dark);
		}
	}

	.handsActive {
		// .hands__dirt{
		//     animation: slideUp 1s infinite;
		//     ani
		// }

		.hands__left,
		.hands__right {
			animation: wiggle 0.5s infinite;
			animation-direction: alternate;
			transform-origin: center;
		}
		.hands__right {
			animation-direction: alternate-reverse;
		}
	}

	.zombiesActive {
		.zombies {
			animation: zombieWalk 40s infinite;
			transform-origin: 80% center;
		}
		.zombie {
			animation: zombieWaddle 0.5s infinite;
			animation-direction: alternate;

			&:nth-child(odd) {
				animation-direction: alternate-reverse;
			}
			&:nth-child(2n) {
				animation-duration: 0.45s;
			}
			&:nth-child(3n) {
				animation-duration: 0.6s;
			}
		}
	}

	@keyframes zombieWalk {
		from {
			scale: 0;
			translate: -100px 100%;
		}
		to {
			scale: 1;
			translate: none;
		}
	}
	@keyframes zombieWaddle {
		from {
			transform: translate(-1px, 0) rotate(-0.5deg);
			translate: 0 2px;
		}
		to {
			transform: rotate(-0.5deg) translate(1.5px, 0);
			translate: 0 -1px;
		}
	}

	@keyframes wiggle {
		from {
			transform: rotate(0.5deg);
		}
		to {
			transform: rotate(-0.5deg);
		}
	}

	@media all and (min-width: 1050px) {
		.tree {
			display: none;
		}
	}
</style>
